// import logo from './logo.svg';
import '../App.css';
import {useState,useEffect}from"react";
function SerchDat() {
  var [lData,setData]=useState([]);
  async function data_get(){
    var resp=await fetch("http://127.0.0.1:8000/api/serch");
    var data=await resp.json();
    setData(data);
  }
  useEffect(()=>{
    data_get();
  },[]
  );
  return (
    <div>
        <form action="" method="post">
        <form className="d-none d-sm-inline-block form-inline mr-auto ml-md-3 my-2 my-md-0 mw-100 navbar-search">
            <div className="input-group">
                <input type="text" className="form-control bg-light border-0 small" placeholder="Search for..."
                                aria-label="Search" aria-describedby="basic-addon2"/>
                    <div className="input-group-append">
                        <button className="btn btn-primary" type="button" onClick={async()=>{
                            var ar=new FormData();
                            ar.append("product_name",prodict_name);
                            ar.append("price",product_price);
                            ar.append("decription",product_about);
                            var seReData=await fetch("http://localhost:8000/api/ins_p",{
                                body:ar,
                            });
                            var data=await seReData.json();
                            console.log(data);
                            props.history.push('/');
                        }}>
                            <i className="fas fa-search fa-sm"></i>
                        </button>
                    </div>
                </div>
        </form>
        </form>
      <table className="table table-hover">
    <thead>
      <tr>
        <th>Name</th>
        <th>Price</th>
        <th>Description</th>
        <th>Add User</th>
        <th>Update</th>
        <th>Delete</th>
      </tr>
    </thead>
    <tbody>
      {lData.map(row=>
      <tr>
        <td>{row.productName}</td>
        <td>{row.price}</td>
        <td>{row.decription}</td>
        <td>{row.name}</td>
        <td><button className="btn btn-danger">Remove</button></td>
        <td></td>
      </tr>
      )}
    </tbody>
  </table>
    </div>
  );
}

export default SerchDat;
